import image1 from "./welcome/welcome_page_1.png";

const imageData = [
    {
        label : "Image1",
        alt: "image1",
        url: "./welcome/welcome_page_1.png"
    },
    {
        label : "Image2",
        alt: "image2",
        url: "./welcome/welcome_page_2.png"
    },
    {
        label : "Image3",
        alt: "image3",
        url: "./welcome/welcome_page_3.png"
    }
]

export default imageData;
